import React, {useState, useEffect} from 'react';
import './DoctorList.css';
import Doctor from '../Doctor/Doctor';

export default function DoctorList(props) {
    const [allDoctors, setAllDoctors] = useState([]);
    console.log("https://ep-doctor-api.herokuapp.com/doctors", { mode: 'no-cors'})

    useEffect(()=> {
        async function getDoctors() {
            const data = await fetch('https://ep-doctor-api.herokuapp.com/doctors', { mode: 'no-cors'});
            const doctors = data.json();
            console.log(doctors);
            setAllDoctors(doctors);
        }
        getDoctors();
    },[]);

    function showDoctors(arr) {
        return arr.map(doctor => {
            return (
                <Doctor doctor={doctor}/>
            )
        })
    }


    return(
        <div className="doctor-list" id="list">
            {showDoctors(allDoctors)}
        </div>
    )


}
